%%
%[text] ### IF ELSE Statement
for x = 21:31 %[output:group:005313b2]
    % x = 21
    if isprime(x) % tests whether a number is prime
        str = 'a prime number';
    elseif ~mod(sqrt(x),1) % tests for a perfect square
        str = 'a perfect square';
    elseif ~mod(log2(x),1) % tests for a power of 2
        str = 'a power of 2';
    elseif mod(x,2)==1
        str = 'odd, but not prime or perfect square';
    else
        str =  'even';
    end

    fprintf('%d is %s\n', x, str) % fprintf outputs directly to the command window %[output:3b1d6f9a]
end %[output:group:005313b2]
%[text] - What happens when x is 16?
%[text] - How would you add an ELSEIF statement to report odd numbers not prime or perfect squares
%[text] - Even numbers not prime?
%[text] - Add a for loop to report on a vector of numbers (e.g. from 11:21) \
%[text] 
%%
%[text] ## Tables
%[text] 1. Create a file path the 'Brain Size Data.xls' file in the data folder
%[text] 2. Read in the table \
filepath = "/Users/ernesto/MATLAB-Drive/MtMdata/unit1/Brain Size Data.xls" %[control:filebrowser:0369]{"position":[12,75]} %[output:5b40a026]
%%
T = readtable(filepath) %[output:12fb7502]
%%
%[text] ### Properties
%[text] Change the Name of the Gender column to 'Sex' using `replace`.
T.Properties.VariableNames = replace(T.Properties.VariableNames,'Gender','Sex') %[output:79aa2202]
%%
%[text] Typecast the Sex column to a categorical array using `convertvars`
% T.Sex = categorical(T.Sex)
T = convertvars(T,"Sex",'categorical') %[output:5422879b]
%%
%[text] Access the Sex column
T.Sex %[output:97b2d285]
%%
%[text] ### Visualization
%[text] Plot a histogram of the FSIQ with 10 bins. 
figure %[output:7265c199]
hb = histogram(T.FSIQ,10); %[output:7265c199]
set(gca,FontSize=18) %[output:7265c199]
%%
%[text] Who is the parent?
%[text] Add a handle `hb` to the histogram and replot 
hb.FaceColor='m' %[output:5accc517] %[output:93e5d3b5]
%[text] - review the properties: Marker, color, etc. \
%%
%[text] Use the handle to change properties of the axes, like font size
hb.Parent %[output:6dacba8d]
hb.Parent.Color = 'cyan' %[output:32bbbb21]
hb.Parent.FontSize=18 %[output:0943f709] %[output:116f7b15]
%%
%[text] Use `gca` to change font size

%[text] 
%%
%[text] Overlay histograms: Male vs female MRI\_Count
%[text] - Add a Title: "BRAIN Size"
%[text] - Add a Subtitle: "Male vs Female brain size" \
figure %[output:67a329ef]
la = T.Sex=="Male";
y = T.MRI_Count(la);
y2 = T.MRI_Count(~la);
histogram(y); %[output:67a329ef]
hold on %[output:67a329ef]
histogram(y2) %[output:67a329ef]
xlabel('MRI Count') %[output:67a329ef]
title("Male vs Female Brain Size") %[output:67a329ef]
legend("Male","Female") %[output:67a329ef]
%%
%[text] How do you add the female values to the histogram?

%%
%[text] ### Box Plots
%[text] Create box plots of the heights
figure %[output:9b8b144d]
boxchart(T.Sex, T.MRI_Count) %[output:9b8b144d]
%[text] Overlay swarm charts
%[text] - Set Markers to Filled
%[text] - Set MarkerFaceAlpha to 0.25
%[text] - Change MarkerFaceColor to Black \
hold on %[output:9b8b144d]
swarmchart(T.Sex, T.MRI_Count,'filled',MarkerFaceAlpha=0.15,MarkerFaceColor='k') %[output:9b8b144d]
%%
%[text] #### Tiled Figures - Violin Plots
%[text] - Create a Horizontally tiled Figure
%[text] - First Tile: Violin plot of Heights
%[text] - Second Tile: Violin Plots of Weights \
figure %[output:11726c2b]
violinplot(T.Sex,T.MRI_Count) %[output:11726c2b]

%%
%[text] #### gscatter 
%[text] Use **gscatter** to Plot Height vs MRI\_Count and use sex as a grouping variable.
%[text] Pro-tip: Assign the data to ***x, y,*** and ***g*** before plotting (keeps the code simpler)
x = T.Height;
y = T.MRI_Count;
g = T.Sex;

figure %[output:4db2b284]
gscatter(x,y,g) %[output:4db2b284]
xlabel('Height') %[output:4db2b284]
ylabel('Brain Size') %[output:4db2b284]
%[text] - Add a Regression Line \
%%
la = isnan(T.Height); % remove all NaNs from data
la = false(height(T),1);
x=T.Height(~la); % get male's heights
y=T.MRI_Count(~la);

hold on % what's this do? %[output:3cb2d143]

p = polyfit(x,y,1); % returns slope and intercept
f = polyval(p,x); % calculate the y's from x using p
plot(x,f,'k-',"LineWidth",1,"DisplayName","Best Fit Line") % plot the regression line %[output:3cb2d143]
%[text] - Remove the NaNs from the data
%[text] - How would you create a logical array for not-nan and male?
%[text] -  \
%%
%[text] #### Creating categorical arrays by discretize
%[text] - Discretize FSIQ to create a categorical arrays with 2 categories: Normal and High
%[text] - Add a new column IQ \
T.IQ = discretize(T.FSIQ,2,'categorical',{'Normal','High'}) %[output:58899a17]
%%
%[text] Compare Brain size to IQ category
figure; %[output:6cd9de69]
violinplot(T.IQ,T.MRI_Count) %[output:6cd9de69]
%[text] - Does weight have anything to do with IQ?
%[text] - What about Height
%[text] - change to a violin plot \
%%
%[text] 
%[text] ## Which is the complement? Which has the LUT inverted?
%[text] ![](text:image:60fc)
%[text] Which Image (Image 1 vs Image 2) is the complement and which image has its look-up table inverted?
%%
%[text] ## Opening Images
%[text] The dot blot image can also be found in the Unit 1 data folder
%[text] - Change the current folder to the data folder
%[text] - Read in the image as `p.img` using the function `imread`
%[text] - We use the structure `p` to organize all of the image processing steps \
close all
clearvars
mmSetUnitDataFolder(1) %[output:3ebf67b2]
p.img = imread("Dot_Blot.png");
figure %[output:4a92548d]
imshow(p.img) %[output:4a92548d]
%[text] - How do we capture the dots? \
%%
%[text] ### Preprocessing steps: Complement
%[text] Remember, we want bright dots
%[text] - Create a complement of the image and assign to p.complement \
p.complement = imcomplement(p.img);
%%
%[text] Programmatically accessing fields in a structure
%[text] - type p.(
%[text] - display the complement image using `imshow` \
imshow(p.complement) %[output:5920fac3]
%%
%[text] ### Filtering the image for Image Contrast enhancement
%[text] Filtering steps often involve the median filter followed by a gaussian filter. Here we add an `adapthist` filter to help separate the dots from the background.
%[text] As you perform these steps, follow the money. Each outcome from the previous step should plug into the function of the next step.
p.median = medfilt2(p.complement);
p.gauss = imgaussfilt(p.median,2);
p.adapt = adapthisteq(p.gauss);
%[text] - we could just overwrite everything, but it is nice to have the intermediate steps captured so we have a visual record of our enhancement steps \
%%
%[text] #### Display the Preprocessing steps
tiledlayout(2,3,"TileSpacing","tight","Padding","tight") % force a 2X3 layout %[output:8cc8009d]
mmShowStruct(p) %[output:8cc8009d]
%[text] - How would you make the tile spacing tight?
%[text] - padding tight? \
%%
%[text] ### Segment 
%[text] Once you have pre-processed the images, then you are ready to segment. Here we just use `imbinarize`. 
p.binarize = imbinarize(p.adapt,'adaptive'); % notice the 'adaptive' addon here
figure %[output:3d4c4a45]
imshow(p.binarize) %[output:3d4c4a45]
%[text] - Usually the binarization process results in noise \
%%
%[text] ### Morphological Operations for Cleanup
%[text] Many of these functions are specific for masks
p.border = imclearborder(p.binarize); % removes noise that touches the edges. 
p.clean = bwareaopen(p.border,500); % clean up small noise
figure %[output:1b3c2135]
imshowpair(p.complement,p.clean) % overlay complement image and final mask %[output:1b3c2135]
%[text] - try different sizes for `bwareaopen` \
%%
%[text] ### Logical Operations
%[text] Mask rows or columns
% mask top rows
topMask = false(size(p.clean)); % create false mask same size as p.clean
topMask(1:141,:) = true; % set top half to true

% mask left side columns
sideMask = false(size(p.clean));  % create false mask same size as p.clean
sideMask(:,1:225) = true; % set right half to true

% display results
figure %[output:6de9b1a9]
tiledlayout("horizontal") %[output:6de9b1a9]
nexttile %[output:6de9b1a9]
imshowpair(p.clean,topMask) %[output:6de9b1a9]
title("Top Mask") %[output:6de9b1a9]

nexttile %[output:6de9b1a9]
imshowpair(p.clean,sideMask) %[output:6de9b1a9]
title("Side Mask") %[output:6de9b1a9]
%%
%[text] #### Logical operations
%[text] - only top dots
%[text] - only bottom dots
%[text] - only side dots
%[text] - only right side dots \
topDots = p.clean & sideMask;
imshow(topDots) %[output:5c0230ff]
%%
%[text] - What about XOR? \
xorDots = xor(topMask,sideMask) & p.clean;
imshow(xorDots) %[output:0aebaf0f]
%%
%[text] ### Region Properties
%[text] The function region properties returns the properties. The 'basic' setting returns Area, Centroid, and Bounding Box.
mask = p.clean;
rp = regionprops(mask,'basic')  %[output:34661965]
%[text] - Is this a table?
%[text] - What is this? \
%%
%[text] Warning. Don't forget to include 'table' as the first input. Otherwise you'll get a structure as shown above. And things won't work as expected
rp = regionprops('table',mask,'basic') % returns a table %[output:5e986e65]
%[text] - each row represents one dot in the dot blot
%[text] - since we didn't include the image, we don't get the mean intensity (we will do that in a bit \
%%
%[text] ### Labeling Images
%[text] We use the function `text` to add labels to an image. This function requires an x and a y coordinate. We can add anything to an image, like your name
figure %[output:9f32301d]
imshow(p.img) %[output:9f32301d]
text(12,12,'Ernesto',Color='magenta',FontSize=3) %[output:9f32301d]
%[text] - Try it now: Replace my name with yours
%[text] - Change the first two inputs `(25,25)` to another coordinate (e.g `12,12`) so that its not overlapping on the dot \
%%
%[text] #### Labeling Dots
%[text] If we want to directly label the dots, we can use the data from the `rp` table. For example, here are the X,Y coordinates of the first dot
x = rp.Centroid(1,1) %[output:309c9240]
y = rp.Centroid(1,2) %[output:6afd7c75]
%%
%[text] And here we add an x to the image on the first dot.
text(x,y,'x','Color','m','FontSize',18,'HorizontalAlignment','center','VerticalAlignment','middle') %[output:5e77ab1e]
%%
%[text] How would you add an plus sign to the second dot?
x = rp.Centroid(end,1) %[output:828e9500]
y = rp.Centroid(end,2) %[output:724adaa8]
%[text] Or an asterisk to the last dot, In magenta
text(x,y,'*',Color='m',HorizontalAlignment='center') %[output:89bb2dbf]
%%
%[text] The function `rectangle` adds a rectangle to the image using the coordinates from the bounding box column in `rp`.
%[text] Here we add a rectangle to the 5th box. 
rectangle('Position', rp.BoundingBox(end,:), 'EdgeColor', 'red',LineWidth=2); %[output:694af2d7]
%[text] - Add a rectangle to the 10th box
%[text] - try adjusting the line width to 2 \
%%
%[text] We can use the power of the FOR LOOP to label all the dots. Here we number the dots based on their order in the `rp` table.
figure % new figure %[output:203b585c]
imshow(p.img) %[output:203b585c]
for n=1:height(rp) %[output:group:195b7da2]
    x = rp.Centroid(n,1);
    y = rp.Centroid(n,2);
    text(x,y,num2str(n),Color='y') % num2str converts a number to a string %[output:203b585c]
end %[output:group:195b7da2]
%[text] - How do we center the numbers?
%[text] - Can we change the size of the numbers?
%[text] - Right-click on `text` to get help \
%%
%[text] Sort ***rp*** by area size and then re-run the FOR LOOP above
rp = sortrows(rp,"Area");
%[text] - what is the order of the numbers different? \
%%
%[text] We can selectively label dots using an IF ELSE statement inside the the FOR LOOP. 
%[text] Here, we add rectangles to dots with area less than the 25th percentile
for n = 1:height(rp) %[output:group:45e010c0]
    if rp.Area(n) < prctile(rp.Area, 25)
        rectangle('Position', rp.BoundingBox(n,:), 'EdgeColor', 'red'); %[output:2a27b0b8]
    end
end %[output:group:45e010c0]
%%
%[text] ### Get Intensity Properties of the Image
%[text] To get the intensity values, you need to add the image to the function call. Here we add the complement as the third input
rp = regionprops('table',mask,p.complement,{'Area','Centroid','MeanIntensity','BoundingBox'}) % add img and 'MeanIntensity' %[output:91ad745f]
%[text] - now we have a column called 'MeanIntensity' that contains the average intensity inside each dot \
%%
%[text] #### Histogram
%[text] Plot a histogram of the MeanIntensity
histogram(rp.MeanIntensity,10) %[output:8119fd5c]
%[text] - there is a wide range of values \
%%
%[text] #### Group Stats
%[text] We can perform group stats
stats = groupsummary(rp,[],["mean" "std" "median"],["Area" "MeanIntensity"]) %[output:1891af77]
%[text] - Notice that the second input is empty brackets — this just means apply the stats to all the rows
%[text] - how do you add std deviation to the calculation? median? \
%%
%[text] #### Bar Plot
%[text] Plot the mean±std as a bar plot
figure %[output:59c596c5]
bar(stats.mean_Area) %[output:59c596c5]
hold on %[output:59c596c5]
errorbar(stats.mean_Area,stats.std_Area,'k') %[output:59c596c5]

